import {
  GET_PAYMENT,
  GET_PROFILE,
  DETAIL_UPDATING_SUCCESS,
  DETAIL_UPDATING_FAIL,
} from './types';

export const clickedProfileButton = (id = null) => {
  return {
    type: GET_PROFILE,
    payload: { id },
  };
};

export const clickedPaymentButton = (id = null) => {
  return {
    type: GET_PAYMENT,
    payload: { id },
  };
};

export const detaiUpdateSuccess = (id = null) => {
  return {
    type: DETAIL_UPDATING_SUCCESS,
    payload: { id },
  };
};
export const detaiUpdateFail = (id = null) => {
  return {
    type: DETAIL_UPDATING_FAIL,
    payload: { id },
  };
};
